nd plums. And fine spirits from apples and pears. We produce ap. 80.000 bottles/year and export to 10 European countries and USA.","from":"Randers, Denmark","logo":{"_type":"image","asset":{"_ref":"image-456565a48feb88cb7f225ac8c2f313217efac043-600x400-jpg","_type":"reference"}},"name":"Cold Hand Winery"},{"_createdAt":"2018-03-24T20:08:39Z","_id":"22f86ab4-cf42-4e81-b68f-b0a6eaa4a221","_rev":"NhgoLbI7zQ3V8Lr5JVFVme","_type":"brewery","_updatedAt":"2018-03-28T13:59:07Z","description":"From Huddersfield, West Yorkshire, UK. Brewing since 2011","from":"Huddersfield, United Kingdom","logo":{"_type":"image","asset":{"_ref":"image-e626a8b95e2330ce0d49e86d814ed83c43854c28-320x270-svg","_type":"reference"}},"name":"Magic Rock Brewing"},{"_createdAt":"2018-03-24T20:13:18Z","_id":"24e5320b-324c-4390-acf1-4c76616619d4","_rev":"V4TuEMvcaqsoSJ9h0YoQhs","_type":"brewery","_updatedAt":"2018-03-28T14:02:52Z","description":"We try to brew delicious beers. Mostly we brew soft, intense hoppy beers.","from":"Cheltenham, United Kingdom","logo":{"_type":"image","asset":{"_ref":"image-8c83bc92ac92a74c91fd82d58a3a8061cbeb7c4f-237x127-svg","_type":"reference"}},"name":"DEYA Brewing Company"},{"_createdAt":"2018-03-27T15:25:52Z","_id":"27a8e223-ca39-42f4-b41c-9f71312f508a","_rev":"C2IDPH3OzNnJ2JQuLo07it","_type":"brewery","_updatedAt":"2018-04-16T08:25:24Z","description":"Brewski don\'t do beer. Beer do Brewski.","from":"Helsingborg, Sweden","logo":{"_type":"image","asset":{"_ref":"image-8241da5fbac4e9378434ad2b980794f39e3b559d-800x800-jpg","_type":"reference"}},"name":"Brewski"},{"_createdAt":"2018-03-24T13:42:07Z","_id":"27c30dfa-e8f0-4607-9dd4-53803a93bc32","_rev":"NhgoLbI7zQ3V8Lr5JVHlt6","_type":"brewery","_updatedAt":"2018-03-28T14:04:20Z","description":"Arizona Wilderness Brewing Company has a true passion for its craft. That passion stems from our owners Jonathan and Patrick\'s exploration of the vastly diverse state of Arizona. They allow their love for Arizona to influence their vision for creating high quality, artfully crafted beers. That passion has turned into a mission in which highlighting Arizona\'s agricultural community is a root cause. It is the essence of naturalism and conservation that truly excites this brewery!\n","from":"Gilbert, AZ, USA","logo":{"_type":"image","asset":{"_ref":"image-b71c45a2ddf0ce676eb0a8b480ce7c71f687650d-514x270-png","_type":"reference"}},"name":"Arizona Wilderness Brewing Co."},{"_createdAt":"2018-03-27T15:55:38Z","_id":"2a2a8d9c-e94a-4a75-83b6-d9e68c453f28","_rev":"C2IDPH3OzNnJ2JQuLo0DsE","_type":"brewery","_updatedAt":"2018-04-16T08:26:01Z","description":"A small batch craft brewery dedicated to the production of farmhouse ales, seasonal styles, and cellaring varieties.","from":"MO, USA","logo":{"_type":"image","asset":{"_ref":"image-e5cac3b363143894a6b55818f85a4ccf1ecedb1c-2667x2000-jpg","_type":"reference"}},"name":"Perennial Artisan Ales"},{"_createdAt":"2018-03-27T15:41:27Z","_id":"2bcf1c49-96f4-43a8-97df-0d4588add5ba","_rev":"toG9CRJuSy5JLeqHY3lUNj","_type":"brewery","_updatedAt":"2018-04-16T08:25:05Z","description":"Dugges Bryggeri was founded by the grandfather of Gothenburg beer Mikael Dugge Engstr√∂m in M√∂lndal, near Gothenburg, Sweden, in the year 2005. The brewery is now located in Landvetter, also near Gothenburg, Sweden, producing approx. 8 000hl/year. ","from":"Landvetter, Sweden","logo":{"_type":"image","asset":{"_ref":"image-c8956ece70bdb68eeb5ac07a68708d097609aeed-1200x480-jpg","_type":"reference"}},"name":"Dugges"},{"_createdAt":"2018-03-24T19:54:07Z","_id":"2eb688a1-3ab0-420d-abef-e010dd333f4d","_rev":"V4TuEMvcaqsoSJ9h0YmXzV","_type":"brewery","_updatedAt":"2018-03-28T13:58:15Z","description":"Focusing on research and development in spontaneous fermentation","from":"Denver, CO, USA","logo":{"_type":"image","asset":{"_ref":"image-850da1b3944d7e43c7ff5ec242c525d34f52d1cf-624x568-svg","_type":"reference"}},"name":"Black Project Beer"},{"_createdAt":"2018-03-24T18:43:21Z","_id":"2ef339e6-e839-48dd-b4fc-c68bfbbb640e","_rev":"V4TuEMvcaqsoSJ9h0YUzE7","_type":"brewery","_updatedAt":"2018-03-28T13:09:08Z","description":"Located on the Oregon Coast, de Garde Brewing is dedicated to barrel aged spontaneous offerings.  Our naturally wild craft draws on historic traditions \u0026 local experimentation. We hope you too will enjoy our terroir \u0026 regionally sourced ingredients. ","from":"Tillamook, OR, USA","logo":{"_type":"image","asset":{"_ref":"image-0bec4d21a6b09ceec00337f0a0b77ad54d3a7b7d-672x672-png","_type":"reference"}},"name":"de Garde Brewing"},{"_createdAt":"2018-03-27T15:29:32Z","_id":"30b53ab0-077e-486e-ae3e-0a5113ea8b30","_rev":"toG9CRJuSy5JLeqHY3lZNS","_type":"brewery","_updatedAt":"2018-04-16T08:25:21Z","description":"BEAVERTOWN:  THE OLD COCKNEY NAME GIVEN TO THE HISTORIC DE BEAUVOIR AREA OF LONDON, FAMED IN VICTORIAN TIMES FOR ITS RICH CHARACTERS AND INFINITE REVELRY ‚Äì THE ORIGINAL STOMPING GROUND OF BEAVERTOWN BREWERY\n\nWe love beer. We believe that great beer is something everyone should get to experience. It brings people together, it gets people talking. Beer is all about relationships.\nThat feeling is the reason we started on this path. In December 2011, Logan Plant set up a brew kit in the kitchen of Duke\'s Brew \u0026 Que in De Beauvoir, Hackney. The kit, situated opposite the two smokers of the BBQ restaurant, ran at 650 liters per brew.\n\n2 years later we‚Äôd moved to Tottenham. Not ones to forget our roots, we brought our original brew kit with us, using it initially to hone the experimental beers, while ‚ÄúBig Beaver,‚Äù ploughed through brews of our core range at 5500 liters per brew. \n\nIn 2015 we took the opportunity to foray in to the wild, repurposing our original brew kit and investing in wood. The original kit sits at the heart of our Tempus Project, surrounded by barrels of every imaginable style and quietly standing as the perfect juxtaposition to the hustle of the main brew house, producing beers that take their own sweet time, to be enjoyed whenever they are ready.\n\nOur mission has always been to produce beers of the highest caliber, driven by our passion for innovation and uncompromising quality. We‚Äôve always aimed to satisfy and stimulate the drinker from the very first sip. Our Core range exemplifies our commitment to consistency, keeping it simple with big punchy hops balanced against a considered grain bill, each beer having its own unique profile. Our Tempus Project is a more untamed beast, moving beyond the realms of t water, barley, hops and yeast into a land of microbes, wild bacteria and wood. Each of these beers with their own little, intrepid journey from brew to bottle. These stories and flavor concepts are reflected in the artwork we wrap our beers in. Whether in can or bottle we want our drinkers to enjoy every aspect of the Beavertown experience and the artwork and designs are an integral part of that.\n\nOf course, our story doesn‚Äôt end here. Here at Beavertown we continue to grow, looking to take another step up with a new brewery site and even bigger brew kit in the works. As always, we will continue to innovate, pushing the boundaries of what a brewery can achieve in beer and beyond. Exploring new styles, methods and techniques, increasing our range and our volumes while never compromising on quality, only limited by our imagination.\n\nWe are Beavertown, beer is what we make, and love, and we want to share it with you.","from":"London, UK","logo":{"_type":"image","asset":{"_ref":"image-a16099cce53b63754d28b89ec5eb6ea3a3238e70-230x219-png","_type":"reference"}},"name":"Beavertown Brewery"},{"_createdAt":"2018-03-23T22:19:32Z","_id":"318af918-0893-4b27-affc-0b860509a4ee","_rev":"V4TuEMvcaqsoSJ9h0Yon0D","_type":"brewery","_updatedAt":"2018-03-28T14:03:55Z","description":"Small farmhouse brewery in Southwest Michigan, specializing in oak aged and spontaneously inoculated ales.","from":"Bridgman, MI, USA","logo":{"_type":"image","asset":{"_ref":"ima